import {CartIcon} from '../assets/CartIcon'


// Bootstrap Template for header bar adapted from Bootstrap Docs example at:
// https://getbootstrap.com/docs/5.1/components/navbar/

const Navbar = ({ setToggleCart, toggleCart}) => {
  return (
    <div>
      <nav class="navbar navbar-light bg-light">
        <div className="container-fluid">
          <a className="navbar-brand">Dan's 3D Printed Minatures</a>
          <form className="d-flex">
            <input
              id="searchBar"
              className="form-control me-2"
              type="search"
              placeholder="Tags: Elves, Sci-Fi, Etc"
              aria-label="Search"
            ></input>
                      </form>

            <button className="btn btn-info" type="submit" onSubmit={event => event.preventDefault()}>
              Search Tags
            </button>
          <button className="btn btn-info" type="submit">
              Sign In
            </button>
            <div id='cartHolder'>          
            <CartIcon 
            setToggleCart={setToggleCart}
            toggleCart={toggleCart}
            />
            </div>
        </div>
      </nav>
    </div>
  );
};

export default Navbar;
